const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: "center",
    color: theme.palette.text.secondary,
  }));

function Gallery() {
   const [blogs, setBlogs] = useState([])

    useEffect(async () => {
      let res = await axios.get("http://localhost:8080/blogs");
