      container
      spacing={{ xs: 2, md: 3 }}
      columns={{ xs: 5, sm: 5, md: 5 }}
    >
      {/* {blogs.map((blog, index) => (
        <Grid item xs={1} sm={1} md={1} key={index}>
          <Item>{blog.author}</Item>
        </Grid>
      ))} */}
    </Grid>
  </div>
  )
}

export default Gallery
